    $('#country').change(function(event) {
        $('#state-container').empty();
        var element_attributes = '';
        var other_option = '';

        if ($('#country').val() == 'US') {
            $('#zip-code').attr('type', 'tel');
            element_attributes = 'required';
        } else if ($('#country').val() == 'CA') {
            $('#zip-code').attr('type', 'text');
            element_attributes = 'required';
        } else if ($('#country').val() == 'AU') {
            $('#zip-code').attr('type', 'tel');
            other_option = '';
        } else if ($('#country').val() == 'PH') {
            $('#zip-code').attr('type', 'tel');
            other_option = '<option disabled>--------------------</option><option value="-">Other</option>';
        } else {
            $('#zip-code').attr('type', 'text');
            other_option = '<option disabled>--------------------</option><option value="-">Other</option>';
        }

        if (countries.hasOwnProperty($('#country').val()) && countries[$('#country').val()].length > 0) {
            var state_input = $('<select id="state" class="form-control " data-placement="auto left" title="State" '+element_attributes+' name="state" autocomplete="address-level1"></select>');

            $.each(countries[$('#country').val()], function(index, val) {
                var option = $('<option value="'+val[0]+'">'+val[1]+'</option>');
                state_input.append(option);
            });

            state_input.append(other_option);
        }
        else{
            var state_input = $('<input id="state" class="form-control " title="State" '+element_attributes+' type="text" name="state" placeholder="State" autocomplete="address-level1">');
        }

        $('#state-container').append(state_input);
    });

