         },
      };


    const elements = stripe.elements()


    var cardNumberElement = elements.create('cardNumber', { style: styleCardNumber });
    cardNumberElement.mount('#card-element');

    var cardExpiryElement = elements.create('cardExpiry', {  style: style });
    cardExpiryElement.mount('#card-expiry-element');

    var cardCvcElement = elements.create('cardCvc', { style: style });
    cardCvcElement.mount('#card-cvc-element');


    const form = document.getElementById('payment-form')
    const cardBtn = document.getElementById('card-button')
    const cardHolderName = document.getElementById('card_name')
    const cardHolderLastName = document.getElementById('last_name')

    form.addEventListener('submit', async (e) => {

        HoldOn.open({
            theme:"sk-circle",
            message:'<style type="text/css">#holdon-overlay{opacity:.9;}#holdon-content{top:37%;}#holdon-message{top:44%;}</style><h3>En traitement...</h3><p style="margin:10px;"><strong>Veuillez patienter, cela peut prendre une minute ou deux.</strong></p><div style="display:flex;align-items:center;width:fit-content;margin:40px auto 0 auto;text-align:left;max-width:460px;text-decoration:underline;font-weight:bold;">Veuillez ne pas fermer ni actualiser. La fermeture de cette fenêtre entraînera une erreur ou un doublon!</div>',

            backgroundColor:"#FFFFFF",
            textColor:"#000000"
        });

      if(cardHolderName.value == '') { document.getElementById('card_name').style.border = '1px solid #ff0064'; }
      else { document.getElementById('card_name').style.border = 'none';}
    
      if(cardHolderLastName.value == '') { document.getElementById('last_name').style.border = '1px solid #ff0064'; }
      else { document.getElementById('last_name').style.border = 'none';}

      e.preventDefault()

      //   cardBtn.disabled = true
        const { setupIntent, error } = await stripe.confirmCardSetup(
            cardBtn.dataset.secret, {
                payment_method: {
                    card: cardNumberElement,
                    billing_details: {
                        name: cardHolderName.value+' '+cardHolderLastName.value
                    }
                }
            }
        )

        if(error) {
            // cardBtn.disable = false
            if(error.code == "setup_intent_unexpected_state") { location.reload(); }
            HoldOn.close();
        } else {

            $input = $('<input type="hidden" name="token"/>').val(setupIntent.payment_method);
            $('#payment-form').append($input);
            
            $.ajax({
                    method: 'POST',
                    url: "/api/checkout" ,
                    data: $('#payment-form').serialize(),
                    success: function( response ) {

                        if(response.redirect_link) { window.location.href = response.redirect_link; }

                        $('#send_form').html('<i class="fa fa-check" aria-hidden="true"></i> Envoyer');
                        $("#send_form").trigger("reset");
                        console.log('response', response);
                        $('#res_message').show();
                        $('#res_message').html(response.data);
                        $('#msg_div').removeClass('d-none');
                       
                        HoldOn.close();
                    },
                    error: function (request, status, error) {
                        HoldOn.close();

                        $('#send_form').html('COMMANDER');
                        $('#res_message').show();
                        $('#res_message').html("ERRORS...");
                    }
                });


        }
    })


